import React from 'react';
import '../css/style-dialog.css';

class ConfirmDialog extends React.Component{
    render(){
        return(
            <div className = "dialog-container">
                <div className  = "dialog-layout">
                <h1>{this.props.phone}</h1>
                <div className ="dialog-button-section">
                    <div className = "primary-btn">
                        <i className = "fa fa-phone card-icon-layout"/>
                        <button className = "primary">Call</button>
                    </div>
                    <div className = "danger-btn">
                        <i className = "fa fa-phone card-icon-layout"/>
                        <button className = "danger" onClick={this.props.onCancelButtonClick} value={null}>Cancel</button>
                    </div>
                </div>
                </div>
            </div>
        );
    }
}

export default ConfirmDialog;
